import React from 'react'
import './someprojects.css';
import Projectcard from './Projectcard';
import ProjectImg from '../assets/images/projectImg.png';
// Import Swiper React components
import { Swiper, SwiperSlide } from 'swiper/react';
// Import Swiper styles
import 'swiper/swiper.min.scss';

export default function Someprojects() {
  return (
    <div>
         <div className="home4">
            <div className="heading">
                <p className='intro3'>
                some of my recent works
                </p>
                <p className='services_text'>
                PROJECTS
                </p>
            </div>
            <div className='someprojects'>
                <Projectcard image={ProjectImg} name="U tracker" text='An application to track your all data from one place. I developed the website and mobile app.' />
                <Projectcard image={ProjectImg} name="U tracker" text='An application to track your all data from one place. I developed the website and mobile app.'/>
                <Projectcard image={ProjectImg} name="U tracker" text='An application to track your all data from one place. I developed the website and mobile app.'/>
                
            </div>
            <Swiper
                    spaceBetween={50}
                    slidesPerView={3}
                    onSlideChange={() => console.log('slide change')}
                    onSwiper={(swiper) => console.log(swiper)}
                    >
                    <SwiperSlide>Slide 1</SwiperSlide>
                    <SwiperSlide>Slide 2</SwiperSlide>
                    <SwiperSlide>Slide 3</SwiperSlide>
                    <SwiperSlide>Slide 4</SwiperSlide>
            </Swiper>
       </div>
    </div>
  )
}
